-- Dane z pliku: createtable.sql --
CREATE TABLE Sedzia (
    SedziaID INTEGER PRIMARY KEY,
    Imie VARCHAR2(50) NOT NULL,
    Nazwisko VARCHAR2(50) NOT NULL,
    Kraj VARCHAR2(20) NOT NULL,
    Poziom VARCHAR2(20) NOT NULL
);

CREATE TABLE Liga (
    LigaID INTEGER PRIMARY KEY,
    NazwaLigi VARCHAR2(50) NOT NULL,
    Kraj VARCHAR2(20) NOT NULL,
    Sezon VARCHAR2(50) NOT NULL
);

CREATE TABLE Stadion (
    StadionID INTEGER PRIMARY KEY,
    Nazwa VARCHAR2(50) NOT NULL,
    Adres VARCHAR2(50) NOT NULL,
    Pojemnosc INTEGER NOT NULL
);

CREATE TABLE Trener (
    TrenerID INTEGER PRIMARY KEY,
    Imie VARCHAR2(50) NOT NULL,
    Nazwisko VARCHAR2(50) NOT NULL,
    Kraj VARCHAR2(50) NOT NULL,
    NrLicencji VARCHAR2(50) NOT NULL,
    WaznoscLicencji DATE NOT NULL
);

CREATE TABLE Zawodnik (
    ZawodnikID INTEGER PRIMARY KEY,
    KlubID INTEGER REFERENCES Klub(KlubID) NOT NULL,
    Imie VARCHAR2(50) NOT NULL,
    Nazwisko VARCHAR2(50) NOT NULL,
    CzyBadaniaZdrowotne VARCHAR2(3) NOT NULL,
    DataUrodzenia DATE NOT NULL,
    Pozycja VARCHAR2(1) NOT NULL CHECK (Pozycja IN ('B', 'O', 'P', 'N'))
);


CREATE TABLE Klub (
    KlubID INTEGER PRIMARY KEY,
    Nazwa VARCHAR2(50) NOT NULL,
    Adres VARCHAR2(100) NOT NULL,
    LigaID INTEGER REFERENCES Liga(LigaID) NOT NULL,
    TrenerID INTEGER REFERENCES Trener(TrenerID) NOT NULL,
    StadionID INTEGER REFERENCES Stadion(StadionID) NOT NULL,
    DataZal DATE NOT NULL
);


CREATE TABLE Mecz (
    MeczID INTEGER PRIMARY KEY,
    KlubGospID INTEGER REFERENCES Klub(KlubID) NOT NULL,
    KlubGoscID INTEGER REFERENCES Klub(KlubID) NOT NULL,
    SedziaGlownyID INTEGER  REFERENCES Sedzia(SedziaID) NOT NULL,
    SedziaAs1ID INTEGER  REFERENCES Sedzia(SedziaID) NOT NULL,
    SedziaAs2ID INTEGER  REFERENCES Sedzia(SedziaID) NOT NULL,
    DataMeczu DATE NOT NULL,
    WynikKoncowy VARCHAR2(10) NOT NULL,
    NrKolejki INTEGER NOT NULL
);

CREATE TABLE SkladMeczowy (
    SkladMeczowyId PRIMARY KEY,
    ZawodnikID INTEGER REFERENCES Zawodnik(ZawodnikID) NOT NULL,
    MeczID INTEGER REFERENCES Mecz(MeczID) NOT NULL,
    RolaWSkladzie VARCHAR2(20) NOT NULL,
    CONSTRAINT UQ_Zawodnik_Mecz UNIQUE (ZawodnikID, MeczID)
);

CREATE TABLE ZdarzenieMecz(
    ZdarzenieMeczID INTEGER PRIMARY KEY,
    MeczID INTEGER REFERENCES Mecz(MeczID) NOT NULL,
    SedziaID INTEGER REFERENCES Sedzia(SedziaID) NOT NULL,
    Minuta INTEGER NOT NULL,
    TypZdarzenieMecz VARCHAR(6) NOT NULL CHECK (TypZdarzenieMecz IN ('Gol', 'Kartka', 'Zmiana'))
);

CREATE TABLE ZdarzenieMeczKartka (
    KartkaID INTEGER PRIMARY KEY NOT NULL,
    ZdarzenieMeczID INTEGER REFERENCES ZdarzenieMecz(ZdarzenieMeczID) NOT NULL,
    ZawodnikKartkowanyID INTEGER REFERENCES Zawodnik(ZawodnikID) NOT NULL,
    KolorKartki VARCHAR(8) NOT NULL CHECK (KolorKartki IN ('Zolta', 'Czerwona'))
);

CREATE TABLE ZdarzenieMeczZmiana (
    ZmianaID INTEGER PRIMARY KEY NOT NULL,
    ZdarzenieMeczID INTEGER REFERENCES ZdarzenieMecz(ZdarzenieMeczID) NOT NULL ,
    ZawodnikWchodzacyID INTEGER REFERENCES Zawodnik(ZawodnikID) NOT NULL,
    ZawodnikSchodzacyID INTEGER REFERENCES Zawodnik(ZawodnikID) NOT NULL

);
CREATE TABLE ZdarzenieMeczGol (
    GolID INTEGER PRIMARY KEY NOT NULL,
    ZdarzenieMeczID INTEGER REFERENCES ZdarzenieMecz(ZdarzenieMeczID) NOT NULL,
    ZawodnikStrzelajacyID INTEGER REFERENCES Zawodnik(ZawodnikID) NOT NULL,
    TypGola VARCHAR2(7) NOT NULL CHECK (TypGola IN ('zwykly', 'karny', 'samoboj'))
);



